import React,{useState} from 'react'
import './findProductAndServives.css'
import ListIcon from '@material-ui/icons/List';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Gridpapers from './Gridpapers';
import Switch, { Case, Default } from 'react-switch-case';

function FindProductAndServives() {

    const [selected, setSelected] = useState('Overview');
    
    const mystyle={
        color: "black",
        background: "white",
        borderRadius:"25%",
        fontSize:"20px"
    }

    function dummy(props){
        return <h1 style={{fontSize:"20px"}}> What is Lorem Ipsum?
        </h1>
    }

    return (
        <div className="fpas-container">
            <h1 className="HeadingText">Comparison Page</h1>
            <br/><br/>
          
            <p className="para"><ListIcon /> {selected}</p>

            <div className="fpas_btn">
                <button value="Overview" onClick={(e)=>setSelected(e.target.value)} className="btn btn-1"><ListIcon style={mystyle} /> Overview</button>
                <button value="Screenshots" onClick={(e)=>setSelected(e.target.value)} className="btn btn-1"><ListIcon style={mystyle} /> ScreenShots</button>
                <button value="UserReviews" onClick={(e)=>setSelected(e.target.value)} className="btn btn-1"><ListIcon style={mystyle} /> UserReviews</button>
                <button value="Prices" onClick={(e)=>setSelected(e.target.value)} className="btn btn-1"><ListIcon style={mystyle} /> Prices</button>
            </div>

            <div className="fpas_papers">
            <Gridpapers   />

            </div> 
            
        </div>
    )
}

export default FindProductAndServives
